import React from 'react';
import Button from '@material-ui/core/Button';
import history from '../../history';
import ReportElementHeader from './ReportElementHeader';


function ReportElementComponent(){

    return(
        <div>
            <ReportElementHeader></ReportElementHeader>
            <div style={{height:"30px",display:"flex",flexDirection:"row",width:"90%",margin:"5px auto",border:"2px solid black",justifyContent:"space-between",alignItems:"center"}}>
                <div>1.</div>
                <div>Name: asdf </div>
                <div>Surname: </div>
                <div style={{marginRight:"10em"}}>T.C.: </div>
            </div>
        </div>
    );
}

export default ReportElementComponent;
